        var calc = function (nodes) {
            var i, j, result = [];
            for (i = 0; i < nodes.length; i++) {
                result[i] = [0, 0];
                for (j = 0; j < nodes.length; j++) {
                    if (nodes[i][0] != nodes[j][0] || nodes[i][1] != nodes[j][1]) {
                        var f = 1 * 1 / ((nodes[i][0] - nodes[j][0]) * (nodes[i][0] - nodes[j][0]) + (nodes[i][1] - nodes[j][1]) * (nodes[i][1] - nodes[j][1]));
                        var d = Math.sqrt((nodes[i][0] - nodes[j][0]) * (nodes[i][0] - nodes[j][0]) + (nodes[i][1] - nodes[j][1]) * (nodes[i][1] - nodes[j][1]));
                        result[i][0] += (f * (nodes[i][0] - nodes[j][0]) / d);
                        result[i][1] += (f * (nodes[i][1] - nodes[j][1]) / d);
                    }
                }
            }
            return result;
        };
